import React, { useState } from "react";
import AppRouter from "./components/AppRouter";
import { Auths } from "./components/context/auths";

const App = () => {
  const [isAuth, setIsAuth] = useState(false);
  return (
    <Auths.Provider value={
      {
        isAuth,
        setIsAuth
      }
    } >
      <Routes>
        <AppRouter />
      </Routes>
    </Auths.Provider>
  )
}

export default App
